import './App.css';
import {BrowserRouter, Route} from "react-router-dom";
import TodoListApp from "./components/TodoListApp/TodoListApp";


function App() {
    return (
        <BrowserRouter>
            <div className="App">
                <h1>Projects</h1>
                <Route path={'todoapp'}>
                    <TodoListApp/>
                </Route>
            </div>
        </BrowserRouter>

    );
}

export default App;
